import React, { Component } from 'react';
import {Link} from 'react-router-dom';
import {Dropdown} from 'react-bootstrap';


export class Navbar extends Component {
  constructor(props) {
    super(props);

    this.toggle = this.toggle.bind(this);
    this.onMouseEnter = this.onMouseEnter.bind(this);
    this.onMouseLeave = this.onMouseLeave.bind(this);
    this.state = {
      dropdownOpen: false
    };
  }

  toggle() {
    this.setState(prevState => ({
      dropdownOpen: !prevState.dropdownOpen
    }));
  }

  onMouseEnter() {
    this.setState({dropdownOpen: true});
  }

  onMouseLeave() {
    this.setState({dropdownOpen: false});
  }
    render() {
      return (
      <nav>
          <ul>
            <li><Link to="/" class='link'>Home</Link></li>
            <li><Link to="/journal" class='link'>Journal</Link></li>
            <li></li>
            <Dropdown className="d-inline-block" onMouseOver={this.onMouseEnter} onMouseLeave={this.onMouseLeave} isOpen={this.state.dropdownOpen} toggle={this.toggle}>
              <Dropdown.Toggle variant="success" id="dropdown-basic">
              <Link to="/selfcare" class='link'>Selfcare</Link>
              </Dropdown.Toggle>

              <Dropdown.Menu>
                <Dropdown.Item><Link to="/mental" class='link'>Mental Selfcare</Link></Dropdown.Item>
                <Dropdown.Item><Link to="/physical" class='link'>Physical Selfcare</Link></Dropdown.Item>
                <Dropdown.Item><Link to="/practical" class='link'>Practical Selfcare</Link></Dropdown.Item>
                <Dropdown.Item><Link to="/social" class='link'>Social Selfcare</Link></Dropdown.Item>
              </Dropdown.Menu>
            </Dropdown>
        </ul>
      </nav>
    );
    }
  }

  export default Navbar;
